// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPatternRenderFunction } from 'js/AwPatternService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPatternService', () => import('js/AwPatternService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awPatternRenderFunction",
            "deps": "js/AwPatternService",
            "options": {
                "elementRefList": [
                    "input"
                ]
            }
        },
        "initialize": {
            "actionType": "JSFunctionAsync",
            "method": "initialize",
            "inputData": {
                "elementRefList": "{{parameters.elementRefList}}",
                "prop": "{{props.prop.fielddata}}"
            },
            "outputData": {
                "_states": null
            },
            "deps": "js/AwPatternService"
        },
        "dropDown": {
            "actionType": "popup",
            "inputData": {
                "options": {
                    "placement": "bottom-start",
                    "maxHeight": "210px",
                    "width": "410px",
                    "toggleMode": true
                }
            }
        }
    },
    "data": {
        "_states": null
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render",
        "onMount": "initialize"
    },
    "props": {
        "prop": {
            "type": "object"
        }
    },
    "_viewModelId": "AwPattern",
    "_uniqueViewModelId": "AwPattern",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPatternRenderFunction, {"elementRefList":["input"]}, ctxImportObj );

export default Component;
